import React from "react";
import "./header.css";
import CTA from './CTA'
import ME from '../../assets/me.png'

const Header = () => {
  return (
    /*We're putting the class of container inside this HTML*/
    <header>
      <div className="container header_container">
        <h5>Hello I'm</h5>
        <h1>David Torres</h1>
        <h5 className="text-light">Fullstack Developer</h5>
        <CTA/>
        <div className="me">
          <img src="" alt="" />
        </div>
      </div>
    </header>
  );
};

export default Header;
